import React from 'react';

const DcPage = () => {
    const handleLogin = ( {history} ) => {
        history.push('/');

    }
    return (
        <div>
            <h1 className="text-success mt-5 text-center">DC</h1>
            <button className="btn btn-primary mt-2" onClick={handleLogin }>Login</button>

        </div>
    );
};

export default DcPage;
